import React, { Component } from "react";
import { NavItem, Nav, NavDropdown, MenuItem } from "react-bootstrap";

class AdminNavbarLinks extends Component {

  // auth
  logOut(e) {
    e.preventDefault()
    localStorage.removeItem('usertoken')
    this.props.history.push(`/`)
  }

  render() {

    // Auth div tag
    const loginRegLink = (
      <ul className="aeye_navbar_ul">
        <li className="aeye_navbar_li" key="8">
          <Link to="/login">로그인</Link>
        </li>

        <li className="aeye_navbar_li" key="9">
          <Link to="/register">회원가입</Link>
        </li>
      </ul>
    )

    const userLink = (
      //로그인 했을 때 user 정보가 뜸
      <ul className="aeye_navbar_ul">
        <li className="aeye_navbar_li" key="5">
          <Link to="/Myprofile">내 정보</Link>
        </li>

        <li className="aeye_navbar_li">
          <a href="" onClick={this.logOut.bind(this)} className="nav-link">
            로그아웃
          </a>
        </li>
      </ul>
    )

    return (
      <div>
        <Nav>
          <NavItem eventKey={1} href="#">
            <i className="fa fa-dashboard" />
            <p className="hidden-lg hidden-md">Dashboard</p>
          </NavItem>
        </Nav>
        <Nav pullRight>
          <NavItem eventKey={1} href="/Register">
            Account
          </NavItem>

          <NavItem eventKey={2} href="/Login">
            Lo
          </NavItem>
        </Nav>
      </div>
    );
  }
}

export default AdminNavbarLinks;
